def cai_process():
    """
    Process codon data from text format into structured lists.
    
    Args:
        codon_data (str): Multiline string containing codon data in tab-separated format
        
    Returns:
        list: A list of lists containing [codons, amino_acids, fractions, frequencies, counts]
    """
    # Initialize lists for each category
    txtfile='RNA_opt/model/RPLoss/tempfile.txt'
    with open(txtfile, 'r') as txtf:
      cnt=-1
      info_list=[]
      for i in range(5):
        info_list.append([])
      info_ind=0
      row_ind=0
      for line in txtf:
        line = line.strip()
        cnt+=1
        
        for fragment in line.split('\t'):
          info_list[info_ind].append(fragment)
          # print(info_ind,fragment)
          # print(fragment)
          pass
          row_ind+=1
          if row_ind//4==1:
            info_ind+=1
            info_ind=info_ind%5
            row_ind=0
        if cnt/3==10:
          cnt=-1
      
      
      
    # print(info_list)
    return info_list


